window.bookSummaryJSON = "<p><b>\"Please welcome the salacious, glitter-gun-slinging hussy, Little Miss Mercury!\"</b></p> <p>Mari is a famous star in her intergalactic troupe. As the headliner at the Comet Canyon Saloon, the last thing she expected to go wrong was being lassoed off stage by a chaps-wearing outlaw.</p> <p>Raider's name has been tarnished by his good-for-nothing brother. The only way to clear it is by kidnapping the precious burlesque gem, Little Miss Mercury. After being stranded together during a desert storm, Mari and Raider discover that there's more between them than a hostage situation gone wrong…</p> <p>One pleasure-inducing stinger, two souls roped together by fate, and an affinity for boots—they're in for a Wild West ride. Will Raider and Mari claim their cosmic love? Or will they be whisked apart by the villain that wants to stop them?</p> <p>Cosmic Crush <i>is book two in the Galactic Gems series. This alien romance contains a chaps-wearing outlaw alien, a pleasure-inducing stinger, fated mates love and fast burn, rope play, boot worship, DVP, and swoony romance with delicious spice.</i></p>"; 
